import React from "react";
import logo from "../image/pagenotfound.png";

const NotFound = () => {
  return (
    <>
      <img className="not-found-img" src={logo} alt="notfound" />
      <p>⚠Ups...Parece que ésta página no existe!⚠</p>
    </>
  );
};

export default NotFound;
